import { useEffect } from "react";
import mc from "./logs-menu.module.scss";
import { useDispatch, useSelector } from "react-redux";

const LogsMenu = () => {
  const dispatch = useDispatch();
  //   logsReducer

  const { logs } = useSelector((store) => {
    return {
      logs: store.logsReducer.logs,
    };
  });

  console.log(logs);

  useEffect(() => {
    dispatch({
      type: "UPDATE_LOGS",
      payload: { newlog: <li>test</li> },
    });
  }, []);

  useEffect(() => {
    dispatch({
      type: "RESET_LOGS",
      payload: { newlog: <li>test</li> },
    });
  }, []);

  return (
    <div className={mc.container}>
      <ul className={mc.log}>
        {logs.map((el, i) => (
          <li key={i}>{el}</li>
        ))}
      </ul>
    </div>
  );
};

export default LogsMenu;
